UNEQUALED
Un*e"qualed, a.

Defn: Not equaled; unmatched; unparalleled; unrivaled; exceeding;
surpassing; -- in a good or bad sense; as, unequaled excellence;
unequaled ingratitude or baseness. [Written also unequalled.]

VANGUARD
Van"guard`, n. Etym: [For vantguard, avantguard, F. avant-garde;
avant before, fore + garde guard. See Avant, Ab-,Ante-, and Guard,
and cf. Advance, Vamp, Van of an army, Vaward.] (Mil.)

Defn: The troops who march in front of an army; the advance guard;
the van.

VITALITY
Vi*tal"i*ty, n. Etym: [L. vitalitas: cf. F. vitalité.]

Defn: The quality or state of being vital; the principle of life;
vital force; animation; as, the vitality of eggs or vegetable seeds;
the vitality of an enterprise.

